import "./App.css";
import React, { Component } from "react";
import Navbar from "./components/Navbar.js";
import News from "./components/News";
import { BrowserRouter, Route, Routes } from "react-router-dom";
// import LoadingBar from "react-top-loading-bar";

export default class App extends Component {
  render() {
    return (

      <div>
        <BrowserRouter>
          <Navbar />
          <Routes>
            <Route
              exact
              path="/"
              element={
                <News key="general" pageSize={9} country="in" category="general" />
              }
            />{" "}
            <Route
              exact
              path="/entertainment"
              element={
                <News
                  key="entertainment"
                  pageSize={9}
                  country="in"
                  category="entertainment"
                />
              }
            />{" "}
            <Route
              exact
              path="/business"
              element={
                <News
                  key="business"
                  pageSize={9}
                  country="in"
                  category="business"
                />
              }
            />{" "}
            <Route
              exact
              path="/health"
              element={
                <News
                  key="health"
                  pageSize={9}
                  country="in"
                  category="health"
                />
              }
            />{" "}
            <Route
              exact
              path="/general"
              element={
                <News
                  key="general"
                  pageSize={9}
                  country="in"
                  category="general"
                />
              }
            />{" "}
            <Route
              exact
              path="/science"
              element={
                <News
                  key="science"
                  pageSize={9}
                  country="in"
                  category="science"
                />
              }
            />{" "}
            <Route
              exact
              path="/sports"
              element={
                <News
                  key="sports"
                  pageSize={9}
                  country="in"
                  category="sports"
                />
              }
            />{" "}
            <Route
              exact
              path="/technology"
              element={
                <News
                  key="technology"
                  pageSize={9}
                  country="in"
                  category="technology"
                />
              }
            />{" "}
          </Routes>{" "}
        </BrowserRouter>{" "}
      </div>
    );
  }
}
